import React,{Component} from 'react';

class ViewShow extends Component{

	static async getInitialProps(query){
		const id = await fetch(`/${query.id}`)
		return{id}
	}

	render(){

		return(
			<h1>Came here {this.props.id}</h1>
		)
	}
}

export default ViewShow;
